import React from 'react';
import Common from './Common';
import web from '../src/images/b3.jpg';

const Home = () => {
    return (
        <>
            <Common name="Grow your Business with Team Of Robox Asus" img_src={web} visit="./service" btname="GetStarted" />
        </>
    );
};

export default Home;
